import{_ as a}from"./chunks/menu_event.DcjW3Ua0.js";import{_ as i,c as n,o,a4 as l}from"./chunks/framework.uQk9_EO2.js";const r="/docs/cocos/assets/animation-panel.CMa2c2yV.png",s="data:image/png;base64,",A="data:image/png;base64,",d="data:image/png;base64,",m="data:image/png;base64,",c="data:image/png;base64,",g="data:image/png;base64,",h="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABUAAAAVCAIAAAAmdTLBAAAACXBIWXMAAA7EAAAOxAGVKw4bAAAAEXRFWHRTb2Z0d2FyZQBTbmlwYXN0ZV0Xzt0AAABeSURBVDiNY3R3d2egADBRonkY6GdB4XEYBCS4aPCxYFX659ONPQs2XPiBR7+qhooIB3bdDAwsIioaqgwXLqMIDrT/R/UPrH7UxHL7xp03MrjT350bt9EFGUfzP0UAAOSlFOTTMdPDAAAAAElFTkSuQmCC",t="data:image/png;base64,",p="data:image/png;base64,",f="data:image/png;base64,",y="data:image/png;base64,",b="data:image/png;base64,",e="data:image/png;base64,",u="data:image/png;base64,",k="/docs/cocos/assets/2-node-list.CxuEwQBR.png",x="data:image/png;base64,",w="/docs/cocos/assets/node-operation.DLq3fU1I.png",C="/docs/cocos/assets/animation-timeline.BIUtjqL3.png",v="/docs/cocos/assets/above-timeline.BxIQaezr.png",B="/docs/cocos/assets/move-line.C9JnEyOL.gif",R="/docs/cocos/assets/time.D2tyX0Oy.png",E="/docs/cocos/assets/frame.DVxHo2x2.png",I="/docs/cocos/assets/times.BTGFiV6e.png",T="/docs/cocos/assets/scale.ByzxcyOO.gif",D="/docs/cocos/assets/scale-canvas.DuzT1gVT.gif",X="/docs/cocos/assets/4-pro-list.x8Aq8mKL.png",S="data:image/png;base64,",V="/docs/cocos/assets/pro-operation.zARUc64Q.png",U="/docs/cocos/assets/animation-property-track.CvhXbQiZ.png",P="/docs/cocos/assets/key-info.Cy2myviw.png",F="/docs/cocos/assets/layout.DT-HQlko.gif",G="/docs/cocos/assets/shortcuts-manager.VYWhXsBV.png",M="/docs/cocos/assets/shortcuts-change.V3Qo6Hxm.png",J=JSON.parse('{"title":"Get Familiar with the Animation Panel","description":"","frontmatter":{},"headers":[],"relativePath":"en/animation/animation-editor.md","filePath":"en/animation/animation-editor.md","lastUpdated":1712305443000}'),Y={name:"en/animation/animation-editor.md"},O=l('<h1 id="get-familiar-with-the-animation-panel" tabindex="-1">Get Familiar with the Animation Panel <a class="header-anchor" href="#get-familiar-with-the-animation-panel" aria-label="Permalink to &quot;Get Familiar with the Animation Panel&quot;">​</a></h1><p>The <strong>Animation</strong> panel is used to edit and preview the animation clip of the currently selected node. When editing animation data or related properties, it will take effect immediately after mouse focus leaves.</p><p>The <strong>Animation</strong> panel is already included in the default layout of Cocos Creator, or open the <strong>Animation</strong> panel by clicking <strong>Panel -&gt; Animation -&gt; Animation Editor</strong> in the main menu above the editor.</p><h2 id="panel-introduction" tabindex="-1">Panel Introduction <a class="header-anchor" href="#panel-introduction" aria-label="Permalink to &quot;Panel Introduction&quot;">​</a></h2><p>The <strong>Animation</strong> panel can be divided into the following main sections.</p><p><img src="'+r+'" alt="animation-editor"></p><ol><li><strong>Toolbar</strong>: some common function buttons, such as play/pause/stop animation, add event frame, save animation, quit editing, etc.</li><li><strong>Node List</strong>: used to display/set the currently selected node and its child nodes.</li><li><strong>Animation timeline and Keyframe Preview</strong>: used to display/set the event frames added to the current node (and its children) and the preview of all keyframes on the added animation property.</li><li><strong>Animation Property List</strong>: used to display/set all animation properties included in the currently edited animation clip for the currently selected node.</li><li><strong>Animation Property Keyframe Preview</strong>: used to display/set all keyframes on each animation property of the currently selected node.</li><li><strong>Related properties of the current animation clip</strong>: used to set the playback mode, playback speed, etc. of the current animation clip.</li></ol><p>For specific content, please refer to the following introduction.</p><h3 id="_1-menu-toolbar" tabindex="-1">1. Menu Toolbar <a class="header-anchor" href="#_1-menu-toolbar" aria-label="Permalink to &quot;1. Menu Toolbar&quot;">​</a></h3><p>The function buttons in the <strong>Menu toolbar</strong> are, from left to right.</p><table><thead><tr><th style="text-align:left;">Icon</th><th style="text-align:left;">Description</th><th style="text-align:left;">Shortcut</th></tr></thead><tbody><tr><td style="text-align:left;"><img src="'+s+'" alt="menu clips"></td><td style="text-align:left;">Toggle animation clips. When multiple animation clips are attached on the Animation component, this button can be used to toggle between clips.</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+A+'" alt="jump to first frame"></td><td style="text-align:left;">Moves the red time control line to the beginning of the current animation clip</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>←</kbd></td></tr><tr><td style="text-align:left;"><img src="'+d+'" alt="jump to previous frame"></td><td style="text-align:left;">Move time control line to previous frame</td><td style="text-align:left;"><kbd>←</kbd></td></tr><tr><td style="text-align:left;"><img src="'+m+'" alt="play/pause"></td><td style="text-align:left;">Play/pause current animation</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>P</kbd></td></tr><tr><td style="text-align:left;"><img src="'+c+'" alt="jump to next frame"></td><td style="text-align:left;">Move the time control line to the next frame</td><td style="text-align:left;"><kbd>→</kbd></td></tr><tr><td style="text-align:left;"><img src="'+g+'" alt="jump to last frame"></td><td style="text-align:left;">Move the time control line to the end of the current animation clip</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>→</kbd></td></tr><tr><td style="text-align:left;"><img src="'+h+'" alt="stop"></td><td style="text-align:left;">Click to stop the current animation, the time control line will move to the first frame after stopping</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>S</kbd></td></tr><tr><td style="text-align:left;"><img src="'+t+'" alt="time"></td><td style="text-align:left;">The scale unit of the timeline are displayed in three ways: <br><strong>Time: 0-00</strong><br><strong>Frame: 0</strong><br><strong>Time (s): 0 s</strong><br> See the <strong>Scale Units of the Timeline</strong> section below for details.</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+p+'" alt="spacing"></td><td style="text-align:left;">Used to set the spacing size between keyframes when multiple keyframes are generated at the same time.</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+f+'" alt="spacing"></td><td style="text-align:left;">Spacing the selected keyframes at the same time. The selected keyframes will be spaced according to the first frame, using the value in the <strong>Spacing</strong> input box as the spacing size.</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><img src="'+a+'" alt="add event"></td><td style="text-align:left;">Add event frame, click this button to add an event frame above the current timeline</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+y+'" alt="menu save"></td><td style="text-align:left;">Save the currently edited animation data.</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+b+'" alt="menu doc"></td><td style="text-align:left;">Click this button to jump to the official manual section on the <strong>Animation</strong> panel</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>S</kbd></td></tr><tr><td style="text-align:left;"><img src="'+e+'" alt="shortcuts"></td><td style="text-align:left;">Open the shortcuts panel, which supports custom shortcuts. See the <strong>Shortcuts</strong> section below for details</td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;"><img src="'+u+'" alt="exit"></td><td style="text-align:left;">Exit animation editing mode</td><td style="text-align:left;"><kbd>Ctrl</kbd> + <kbd>Q</kbd></td></tr></tbody></table><h3 id="_2-node-list" tabindex="-1">2. Node list <a class="header-anchor" href="#_2-node-list" aria-label="Permalink to &quot;2. Node list&quot;">​</a></h3><p><img src="'+k+'" alt="node list"></p><p>This area shows the currently selected animation nodes and their children, arranged in a way that corresponds to the node tree in the <strong>Hierarchy</strong> panel. Click on the top <img src="'+x+'" alt="hide"> button to hide/show nodes without animation data, or just type the node name in the input box to quickly find the node.</p><p>Currently, it is possible to right-click on a node to clear, migrate, copy and paste node data. For details, please refer to the <a href="./edit-animation-clip#common-operations-on-node-data">Common operations on node data</a> documentation.</p><p><img src="'+w+'" alt="node operation"></p><h3 id="_3-animation-timeline-and-keyframe-preview" tabindex="-1">3. Animation timeline and keyframe preview <a class="header-anchor" href="#_3-animation-timeline-and-keyframe-preview" aria-label="Permalink to &quot;3. Animation timeline and keyframe preview&quot;">​</a></h3><p><img src="'+C+'" alt="animation timeline"></p><p>The animation timeline is mainly used to display/set the custom <a href="./animation-event">event frames</a> added to the current node, the <a href="./edit-animation-clip">keyframes</a> (blue diamond) of all animation properties added to the node (and its children) and to show the preview.</p><p>The time control line (red vertical line) indicates the time the current animation is at, and the currently selected time can be changed in several ways:</p><ul><li><p>Drag and drop the time control line directly</p></li><li><p>Double click on the keyframe</p></li><li><p>Using the relevant move control buttons in the menu toolbar</p></li><li><p>Use shortcut keys, which can be found in the <strong>Shortcuts</strong> section below</p></li><li><p>Click anywhere in the upper area of the animation timeline</p><p><img src="'+v+'" alt="about the timeline"></p></li></ul><p>If the time control line is moved, the nodes in the <strong>Scene</strong> panel will also move accordingly to the animation track.</p><p><img src="'+B+'" alt="move line"></p><h4 id="scale-unit-display-of-the-timeline" tabindex="-1">Scale unit display of the timeline <a class="header-anchor" href="#scale-unit-display-of-the-timeline" aria-label="Permalink to &quot;Scale unit display of the timeline&quot;">​</a></h4><p>The <img src="'+t+'" alt="time"> button in the <strong>Toolbar</strong> can be used to toggle the way the scale unit of the timeline is displayed. The value in the input box will change with the movement of the time control line. Manual input is supported, and the time control line will be automatically positioned to the corresponding position after the input is finished.</p><p>The following three display methods are currently supported:</p><ul><li><p><strong>Time: 0-00</strong> (default): the animation timeline scale is displayed as a combination of seconds and frames. The value in front of the input box means <strong>seconds</strong>, and the value after it means <strong>frames</strong>, for example <code>01-05</code> means 1 second and 5 frames.</p><p><img src="'+R+'" alt="time"></p></li><li><p><strong>Frame: 0</strong>: display the scale of the animation timeline in terms of frames.</p><p><img src="'+E+'" alt="frame"></p></li><li><p><strong>Time(s): 0 s</strong>: display the scale of the animation timeline in seconds.</p><p><img src="'+I+'" alt="times"></p></li></ul><p>The frame rate (Sample) is generally used to indicate how many frames a second is to be divided into, which can be adjusted in the <strong>Sample</strong> option at the bottom of the <strong>Animation</strong> panel. This is affected to a different extent when the scale unit of the timeline is displayed in different ways.</p><p>When the scale unit is set to <strong>Frame</strong>, it is in frames and is not affected by the frame rate. <br> When set to <strong>Time</strong> or <strong>Time(s)</strong>, the same scale represents a different point in time as the frame rate changes, and the conversion between the two is calculated as follows:</p><table><thead><tr><th style="text-align:left;">Frame Rate (Sample)</th><th style="text-align:left;">Time: 00-00</th><th style="text-align:left;">Time (s): 0 s</th></tr></thead><tbody><tr><td style="text-align:left;">30</td><td style="text-align:left;">01-05</td><td style="text-align:left;">1 + 5/30 = 1.17 s</td></tr><tr><td style="text-align:left;">10</td><td style="text-align:left;">01-05</td><td style="text-align:left;">1 + 5/10 = 1.5 s</td></tr></tbody></table><p>For example, if the frame rate is set to 30 and a keyframe is added to the <code>01-05</code> scale, the keyframe will be at frame 35 after the animation starts. Changing the frame rate to 10, the total number of frames where the keyframe is located does not change, it is still at frame 35 after the start of the animation, and the scale reading at the keyframe location becomes <code>03-05</code>, which translates to exactly 3 times the previous time (s).</p><h4 id="changing-the-animation-timeline-scale" tabindex="-1">Changing the animation timeline scale <a class="header-anchor" href="#changing-the-animation-timeline-scale" aria-label="Permalink to &quot;Changing the animation timeline scale&quot;">​</a></h4><p>If the <strong>Animation</strong> panel display is too small and needs to be enlarged for more keyframes to be displayed within the editor, Just simply scroll the mouse wheel in either <strong>Animation Timeline</strong> and <strong>Animation Property Keyframe Preview</strong> area to scale the timeline up or down.</p><p><img src="'+T+'" alt="scale"></p><h4 id="moving-the-animation-timeline-display-area" tabindex="-1">Moving the animation timeline display area <a class="header-anchor" href="#moving-the-animation-timeline-display-area" aria-label="Permalink to &quot;Moving the animation timeline display area&quot;">​</a></h4><p>Drag and drop the middle/right mouse button in any area of the <strong>Animation Timeline</strong> or <strong>Animation Property Keyframe preview</strong> to see the hidden keyframes on the left/right side of the animation timeline that are outside the display area.</p><p><img src="'+D+'" alt="scale canvas"></p><h3 id="_4-list-of-animation-property" tabindex="-1">4. List of animation property <a class="header-anchor" href="#_4-list-of-animation-property" aria-label="Permalink to &quot;4. List of animation property&quot;">​</a></h3><p><img src="'+X+'" alt="node list"></p><p>This area is mainly used to display/add/set the animation property of the currently selected node in the current Animation Clip. The animation properties include the node&#39;s own properties, component properties (including those in user-defined script components), and the animation properties are added by clicking the <strong>+</strong> button in the upper right corner. Component properties are prefixed with the name of the component, e.g.: <code>cc.Sprite.spriteFrame</code>.</p><p>Right-click on the animation property or click <img src="'+S+'" alt="property"> button to the right of the animation property to select <strong>Remove Prop Track</strong>, <strong>Clear Keyframe Data</strong>, or <strong>Copy Prop Track</strong>. For details, please refer to the <a href="./edit-animation-clip#Common-operations-on-animation-property-data">Common operations on animation property data</a> documentation.</p><p><img src="'+V+'" alt="property operation"></p><h3 id="_5-keyframe-preview-of-the-animation-property" tabindex="-1">5. Keyframe preview of the animation property <a class="header-anchor" href="#_5-keyframe-preview-of-the-animation-property" aria-label="Permalink to &quot;5. Keyframe preview of the animation property&quot;">​</a></h3><p><img src="'+U+'" alt="animation property track"></p><p>This area is mainly used to display the specific keyframe settings of the currently selected node on each animation property, and is also the main area for keyframe editing. Keyframes can be added by right-clicking on the animation property on the right side. This area also supports the ability to move, copy, and paste keyframes by checking and tapping on them. For details, please refer to the <a href="./edit-animation-clip#common-keyframe-operations">Common keyframe operations</a> documentation.</p><p>When clicking on a keyframe, it will turn from blue to white and information about it will be displayed above the area, and double-clicking on the keyframe will move the time control line to its location.</p><p><img src="'+P+'" alt="key info"></p><h3 id="_6-related-properties-of-the-current-animation-clip" tabindex="-1">6. Related properties of the current animation clip <a class="header-anchor" href="#_6-related-properties-of-the-current-animation-clip" aria-label="Permalink to &quot;6. Related properties of the current animation clip&quot;">​</a></h3><p>The properties of the current Animation Clip that can be set directly on the <strong>Animation</strong> panel include: <strong>WrapMode</strong>, <strong>Sample</strong>, <strong>Speed</strong> and <strong>Duration</strong>. For details, please refer to the <a href="./edit-animation-clip#animation-clip-properties-settings">Animation Clip Properties Settings</a> documentation.</p><h2 id="adjusting-the-layout-of-the-animation-panel" tabindex="-1">Adjusting the Layout of the Animation Panel <a class="header-anchor" href="#adjusting-the-layout-of-the-animation-panel" aria-label="Permalink to &quot;Adjusting the Layout of the Animation Panel&quot;">​</a></h2><p>The dividers between the node list and the timeline, and between the property list and the timeline are available for dragging and dropping to change the layout. By dragging and dropping it is possible to freely adjust the <strong>Animation</strong> panel to a layout effect suitable for editing.</p><p><img src="'+F+'" alt="layout"></p><h2 id="shortcut-keys" tabindex="-1">Shortcut keys <a class="header-anchor" href="#shortcut-keys" aria-label="Permalink to &quot;Shortcut keys&quot;">​</a></h2><p>Click on the menu toolbar&#39;s <img src="'+e+'" alt="shortcuts"> button in the menu toolbar to open the shortcuts panel:</p><p><img src="'+G+'" alt="shortcuts manager"></p><p>Shortcuts can be customized in the <strong>Animation</strong> panel. Directly click the shortcut key combination of the function to be modified. A prompt will appear as shown below.</p><p><img src="'+M+'" alt="shortcuts change"></p><h3 id="default-shortcut-key-summary" tabindex="-1">Default shortcut key summary <a class="header-anchor" href="#default-shortcut-key-summary" aria-label="Permalink to &quot;Default shortcut key summary&quot;">​</a></h3><table><thead><tr><th style="text-align:left;">Function</th><th style="text-align:left;">Shortcut</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;">Enter/exit <strong>Animation</strong> panel</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>E</kbd></td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;">Save animation data</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>S</kbd></td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;">Move forward one frame</td><td style="text-align:left;"><kbd>←</kbd></td><td style="text-align:left;">Ignore current operation if already at frame 0. Move the time control line when the keyframe is not selected, move the keyframe when the keyframe is selected.</td></tr><tr><td style="text-align:left;">Move back one frame</td><td style="text-align:left;"><kbd>→</kbd></td><td style="text-align:left;">Move the time control line when the keyframe is not selected, move the keyframe when the keyframe is selected.</td></tr><tr><td style="text-align:left;">Move to the first frame</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>←</kbd></td><td style="text-align:left;">Move the red time control line to the beginning of the current animation clip.</td></tr><tr><td style="text-align:left;">Move to the last frame</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>→</kbd></td><td style="text-align:left;">Move the time control line to the end of the current animation clip.</td></tr><tr><td style="text-align:left;">Delete the currently selected keyframe</td><td style="text-align:left;"><kbd>Delete</kbd> / <kbd>Cmd</kbd> + <kbd>Backspace</kbd></td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;">Play/Pause Animation</td><td style="text-align:left;"><kbd>P</kbd></td><td style="text-align:left;">-</td></tr><tr><td style="text-align:left;">Stop animation</td><td style="text-align:left;"><kbd>Alt</kbd> + <kbd>S</kbd></td><td style="text-align:left;">The current time will change to 0 and the time control line will move to the first frame.</td></tr><tr><td style="text-align:left;">Add keyframe</td><td style="text-align:left;"><kbd>K</kbd></td><td style="text-align:left;">When any animation property is selected, a keyframe will be added at the location of the time control line, ignored if no animation property is selected.</td></tr><tr><td style="text-align:left;">Jump to previous keyframe</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>←</kbd></td><td style="text-align:left;">Move the time control line to the nearest keyframe on the left (on the selected property track or on the selected node).</td></tr><tr><td style="text-align:left;">Jump to the next keyframe</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>Shift</kbd> + <kbd>→</kbd></td><td style="text-align:left;">Move the time control line to the nearest keyframe on the right (on the selected property track or on the selected node).</td></tr><tr><td style="text-align:left;">Multi-select keyframes</td><td style="text-align:left;"><kbd>Ctrl</kbd></td><td style="text-align:left;">Hold down <kbd>Ctrl</kbd> and click on a keyframe to multi-select a keyframe.</td></tr><tr><td style="text-align:left;">Select all animation property keyframes</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>A</kbd></td><td style="text-align:left;">Select all keyframes on the selected animation property.</td></tr><tr><td style="text-align:left;">Copy selected animation data</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>C</kbd></td><td style="text-align:left;">Supports copying selected keyframes, property tracks, and node data, while only one type of data can be copied, and the copying priority is determined in this order.</td></tr><tr><td style="text-align:left;">Paste last copied animation data</td><td style="text-align:left;"><kbd>Ctrl</kbd>/<kbd>Cmd</kbd> + <kbd>V</kbd></td><td style="text-align:left;">Support to paste last copied animation data (e.g.: animation keyframes, animation properties, animation node data, and check the currently available data in that order) across editors (v3.x only).</td></tr><tr><td style="text-align:left;">Unchecked keyframes/event frames/property tracks</td><td style="text-align:left;"><kbd>Esc</kbd></td><td style="text-align:left;">-</td></tr></tbody></table><blockquote><p><strong>Note</strong>: currently, all shortcuts require mouse focus on the Animation Editor panel to take effect, except for the shortcuts <strong>Enter/Exit Animation Editor</strong> and <strong>Save Animation</strong> which are globally available.</p></blockquote>',60),z=[O];function N(Z,H,K,W,Q,L){return o(),n("div",null,z)}const _=i(Y,[["render",N]]);export{J as __pageData,_ as default};
